function handler(event) {
    var request = event.request;
    var uri = request.uri;

    // Check if URI is ending with '/admin' or '/admin/'
    if (uri.endsWith('/admin') || uri.endsWith('/admin/')) {
        // Rewrite URI to '/admin/index.html'
        request.uri = '/admin/index.html';
    }
    return request;
}
